import React from 'react';
import './Menu.css';
import SearchBar from './SearchBar';

const Menu = () => {
  return (
    <nav className="menu">
      <ul className="menu">
        <li><a href="#">Quem Somos</a></li>
        <li><a href="#">Contato</a></li>
        <li><a href="#">Login</a></li>
        <li><a href="#">Cadastre-se</a></li>
      </ul>
    <SearchBar/>
    </nav>
  );
}

export default Menu;
